import { setLimits } from '../reducers/limitsSlice';

const mockData = {
  maxBet: 100,
  minBet: 1,
  maxWin: 5000,
  currency: 'USD',
};

export const getLimits = () => async dispatch => {
//   try {
    console.log('mayis');
    // Simulate an API request delay with setTimeout
    dispatch(
      setLimits({
        maxBet: 100,
        minBet: 1,
        maxWin: 5000,
        currency: 'USD',
      }),
    );
    return mockData;
//   }
